        will-change: scroll-position;

        position: absolute;
        top: 0;
        left: 0;
        height: 1px;
        width: 1px;
        transform-origin: 0 0;
        pointer-events: none;

        position: sticky;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;

    .p-virtualscroller-horizontal > .p-virtualscroller-content {
